INSERT INTO `comments_comment` VALUES (16,'test','test@byincd.com','check','2018-08-11 10:49:22.081665',38),(17,'Bo','bobjiang@byincd.com','new comment','2018-08-11 10:51:42.822599',38),(19,'Bo','test@byincd.com','提交了','2018-08-11 11:39:22.628285',38),(22,'小虎','10406043@163.com','同感','2018-10-16 13:21:34.295191',53),(23,'Yan','494374296@qq.com','对于生命心怀感激，对于生活知足感恩，珍惜每一个陪伴的瞬间，抱有一颗单纯善良的心。','2019-01-02 10:04:26.002151',58),(24,'chen','578056709@qq.com','最近一年我也经常会有这种感触，时常会觉得生活无聊，不懂这样的生活有什么意义，且还会被各种琐事困扰，有时都觉得这种生活很痛苦，但是想想支持自己的亲人朋友，又有了坚持下去的动力。珍惜每一天，自己不觉得虚度光阴就好了吧','2019-01-02 12:50:51.749069',58),(25,'guoqiang','yanguoqianghb@foxmail.com','使用--adb host这种只能再加一台机器吧；','2019-03-26 11:21:28.767920',64),(26,'guoqiang','yanguoqianghb@foxmail.com','如果我要再加一台机器，就是1台Master上装stf，还有两台Slave未安装stf，这里--adb-host参数该如何添加？谢谢','2019-03-26 11:23:45.168144',64),(27,'Bo','jbsv43@sina.com','@guoqiang, 我现在暂时没有多余的设备验证你提到的问题，如果你目前比较急的话，可以用usb分线器让足够多的手机连接到你的机器上','2019-03-26 15:52:22.590227',64),(28,'Sam','10406043@163.com','可以使用ready的值来判断吗？','2019-04-04 11:33:59.722724',68),(31,'Bo','jbsv43@sina.com','@Sam, “ready”不准确，当你的手机未连接时仍可能为true，所以用的“present”。','2019-04-04 13:58:39.689750',68),(32,'Bo','bobjiang@byincd.com','validate','2019-04-06 19:19:53.256733',38),(33,'Bo','jbsv43@sina.com','20190409','2019-04-09 10:28:23.498414',38),(34,'Bo','jbsv43@sina.com','20190412','2019-04-12 13:55:53.995571',38),(35,'bob','bobjiang4321@gmail.com','20190712','2019-07-12 08:10:16.777805',38),(36,'wadewu','wadewuu@outlook.com','你好，请问c.NotebookApp.notebook_dir = u\'/path/jupyter\'，这一项应该填什么呢？','2019-09-04 10:28:33.622164',61),(37,'wadewu','wadewuu@outlook.com','你好，请问c.NotebookApp.notebook_dir = u\'/path/jupyter\'，这一项应该填什么呢？','2019-09-04 10:28:34.562825',61),(38,'Bo','jbsv43@sina.com','@wadewu 这里的值是你配置的jupyter启动的根目录路径，比如c.NotebookApp.notebook_dir = u\'/home/debug/jupyter\'','2019-09-04 10:44:12.191523',61);
